import React from 'react';
import './GreenBox.css';
import FileUpload from './FileUploadWithIcon';
import ColBox from './ColBox';
import useState  from 'react';


const GreenPaddingWhiteFill = () => {
  const [colBoxData, setColBoxData] = useState([]);

  // Callback function to update colBoxData when FileUpload gets a response
  const handleFileUploadResponse = (responseData) => {
    setColBoxData(responseData);
  };
    return (
      <div className="outer-container">
      <div className="inner-container">
        {/* Your content goes here */}
        <div className="fileflex">
        <FileUpload onResponse={handleFileUploadResponse}/>
        
        </div>

        <div className="down-container">
          <ColBox  data={colBoxData}/>
        </div>

      </div>
    </div>

    );
  };
  
  export default GreenPaddingWhiteFill;
